export default () => {
  const excludeStoreColdef = [
    {
      Header: 'Store ID',
      accessor: 'store_id',
    },
    // {
    //   Header: "Store Description",
    //   accessor: "store_desc"
    // },
    {
      Header: 'Sell Through %',
      columns: [
        {
          Header: 'LY',
          accessor: 'sell_through.ly',
        },
        {
          Header: 'TY',
          accessor: 'sell_through.ty',
        },
      ],
    },
    {
      Header: 'Margin %',
      columns: [
        {
          Header: 'LY',
          accessor: 'margin.ly',
        },
        {
          Header: 'TY',
          accessor: 'margin.ty',
        },
      ],
    },
    {
      Header: 'Inventory On Hand',
      accessor: 'inv_onhand',
    },
    {
      Header: 'Actual Sales',
      accessor: 'actual_sales',
    },
    {
      Header: 'Model Predicted Sales',
      accessor: 'model_predicted_sales',
    },

    {
      Header: 'Sales Contribution %',
      accessor: 'sales_units',
    },
  ];
  return excludeStoreColdef;
};
